import logo from './logo.svg';
import './App.css';
import React from 'react';
import { Content } from './component/content';
import { Header } from './component/header';
import { Footer } from './component/footer';

class App extends React.Component{

  render(){
    return(
      <div className="App">
        <Header> </Header>
        <Content></Content>
        <Footer></Footer>
      </div>
    );
  }
}

export default App;
